import React, { Component } from "react";
import ReszvetelService from "../service/ReszvetelService";

class EredmenyComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      reszvetelek: [],
    };
  }
  componentDidMount() {
    ReszvetelService.getResztvetelek().then((res) => {
      this.setState({
        reszvetelek: res.data,
      });
      console.log(this.state.reszvetelek);
    });
  }
  render() {
    return (
      <div>
          <input
            style={{ margin: "0 auto" }}
            placeholder="Introduci rasa"
            type="text"
            onChange={(e) => this.handleSearch(e)}
          />
          <SearchResults
            value={this.state.search}
            data={this.state.fajtak}
            renderResults={(results) => (
              <div className="fajtaContainer">
                {" "}
                {results.map((fajta) => (
                  <article className="initialBox" key={fajta.id}>
                    <div>
                      <img
                        className="fajtaImg"
                        src={"../img/fajtak/" + fajta.kep}
                        alt=""
                      />
                    </div>
                    <div className="leiras">
                      <div>
                        <h2>{fajta.fajta}</h2>
                        <div className="szoveg">{fajta.bemutatkozo}</div>
                      </div>
                      <button id={fajta.rovidites} className="button">
                        <Link to={`/fajtaleirasok/${fajta.rovidites}`}>
                          Citește mai mult
                        </Link>
                      </button>
                    </div>
                  </article>
                ))}
              </div>
            )}
          />
        <table className="tagokTable">
          <thead>
            <tr>
              <th>Rasa</th>
              <th>Urechea dreaptă</th>
              <th>Urechea stânga</th>
              <th>Crescător</th>
              <th>Punctaj</th>
            </tr>
          </thead>
          <tbody>
            {this.state.reszvetelek.map((kiallitas) => (
              <tr key={kiallitas.id}>
                <td>{kiallitas.kisallat.fajta.fajta}</td>
                <td>{kiallitas.kisallat.jobbful}</td>
                <td>{kiallitas.kisallat.balful}</td>
                <td>{kiallitas.kisallat.tulaj.nev}</td>
                <td>{kiallitas.pontszam}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default EredmenyComponent;
